import React from 'react';

// Small SVG candlestick chart placeholder
function MiniCandleChart() {
  // Example: 6 candles, random up/down
  const candles = [
    { x: 5, open: 30, close: 20, high: 35, low: 15, up: false },
    { x: 20, open: 20, close: 28, high: 30, low: 18, up: true },
    { x: 35, open: 28, close: 25, high: 32, low: 22, up: false },
    { x: 50, open: 25, close: 35, high: 38, low: 24, up: true },
    { x: 65, open: 35, close: 32, high: 37, low: 30, up: false },
    { x: 80, open: 32, close: 40, high: 42, low: 30, up: true },
  ];
  return (
    <svg width="90" height="48" viewBox="0 0 90 48" className="block mx-auto" style={{ display: 'block' }}>
      <rect x="0" y="0" width="90" height="48" rx="6" fill="#181A20" />
      {candles.map((c, i) => (
        <g key={i}>
          {/* Wick */}
          <rect x={c.x + 5} y={Math.min(c.high, c.low)} width={2} height={Math.abs(c.high - c.low)} fill={c.up ? '#16c784' : '#ea3943'} rx={1} />
          {/* Body */}
          <rect
            x={c.x}
            y={Math.min(c.open, c.close)}
            width={12}
            height={Math.max(4, Math.abs(c.open - c.close))}
            fill={c.up ? '#16c784' : '#ea3943'}
            rx={2}
            opacity={0.9}
          />
        </g>
      ))}
    </svg>
  );
}

export default function FeedCard({
  icon,
  name,
  subtitle,
  roi,
  holders,
  dh,
  t10,
  mc,
  ath,
  vol,
  chart,
  onWatch,
  onDetails
}) {
  return (
    <div className="group relative bg-zinc-900/70 rounded-xl border border-zinc-700/40 shadow-lg p-4 flex flex-col gap-2 hover:border-green-400/40 hover:shadow-green-400/10 transition-all cursor-pointer">
      <div className="flex items-center gap-3 mb-1">
        <div className="w-12 h-12 rounded-lg bg-zinc-800 border border-zinc-700 flex items-center justify-center text-2xl overflow-hidden">
          {icon || <span className="text-zinc-500">?</span>}
        </div>
        <div className="flex-1 min-w-0">
          <div className="flex items-center gap-2">
            <span className="font-bold text-white text-lg truncate">{name}</span>
            <span className="ml-2 px-2 py-0.5 rounded bg-green-900/30 text-green-400 text-xs font-bold">{roi}</span>
          </div>
          <div className="text-zinc-400 text-xs truncate">{subtitle}</div>
        </div>
        <button
          className="ml-2 p-1 rounded-full bg-zinc-800 hover:bg-green-900/30 transition text-green-400"
          title="Watch"
          onClick={e => { e.stopPropagation(); onWatch && onWatch(); }}
        >
          <svg width="18" height="18" fill="none" viewBox="0 0 24 24"><path d="M12 5c-7 0-9 7-9 7s2 7 9 7 9-7 9-7-2-7-9-7zm0 12a5 5 0 110-10 5 5 0 010 10z" stroke="currentColor" strokeWidth="2"/></svg>
        </button>
      </div>
      <div className="flex items-center gap-3 text-xs text-zinc-400 mb-1">
        <span>Holders: <span className="text-white font-semibold">{holders}</span></span>
        <span>DH: <span className="text-white font-semibold">{dh}</span></span>
        <span>T10: <span className="text-white font-semibold">{t10}</span></span>
      </div>
      <div className="flex items-center gap-3 text-xs text-zinc-400 mb-1">
        <span>MC: <span className="text-white font-semibold">{mc}</span></span>
        <span>ATH: <span className="text-white font-semibold">{ath}</span></span>
        <span>Vol: <span className="text-white font-semibold">{vol}</span></span>
      </div>
      {/* Mini SVG candlestick chart */}
      <div className="w-full flex justify-center my-1">
        <MiniCandleChart />
      </div>
      <div className="flex gap-2 mt-2">
        <button
          className="flex-1 py-1 rounded-lg bg-zinc-800 text-zinc-300 hover:bg-green-900/30 hover:text-green-400 transition text-xs font-semibold"
          onClick={e => { e.stopPropagation(); onDetails && onDetails(); }}
        >
          Details
        </button>
        <button
          className="flex-1 py-1 rounded-lg bg-green-500/10 text-green-400 hover:bg-green-500/20 transition text-xs font-bold"
          onClick={e => { e.stopPropagation(); onWatch && onWatch(); }}
        >
          + Watch
        </button>
      </div>
    </div>
  );
}
